import React from 'react';
import './App.css';
//import { Provider } from 'react-redux';
import Header from './components/headBar.js'
import {BrowserRouter as Router, Route} from 'react-router-dom';



function App() {
  return (
    <Router>
      <div className="App">
          <Header/>
      </div>
    </Router>
  );
}

export default App;
